// src/App.js
import React from 'react';
import { Routes, Route, BrowserRouter } from 'react-router-dom'; // Only Routes and Route
import './App.css';

import Header from './components/header';
import Navbar from './components/navbar';
import Footer from './components/footer';
import Home from './components/home';
import Login from './pages/login';
import Companies from './pages/companies'; // Uncomment if you have a Companies page
import Register from './pages/register'; // Uncomment if you have a Register page

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Header />
      <Home />
      <Login />
      <Companies />
      <Register />
      <Footer />

       {/* Navbar is outside of Routes, so it shows on all pages */}
      <Routes>
        <Route path="/navbar" element={<Navbar />} />
        <Route path="/header" element={<Header />} />
        <Route path="/home" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/companies" element={<Companies />} />
        <Route path="/register" element={<Register />} />
        <Route path="/footer" element={<Footer />} />
      </Routes>
      </BrowserRouter>

  );
}

export default App;
